        // fetch(API_URL + '/posts/1', {
        //     method: 'DELETE'
        // })
        console.log('/////////// DELETE //////////')
    }

    constructor(props){
        super(props)
        this.state = {
            list: this.props.list
        }
      }



      render() {
          return (
                <div>
                    <ul>
                    {this.props.list.map(val => (
                        <ArticleListItem article = {val} key = {val.id}/>

                    ))}
                    <button onClick={this.articleDelete()}>suprimer</button>
                    </ul>    
              </div>
          )
      }

}

export default ArticleList
